INSERT INTO `locales_source` VALUES ('2692','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','User edit template','','7.50'),('2693','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','When enabled, this overrides the default Drupal behavior for displaying user edit form at <em>user/%user/edit</em>.','','7.50'),('2694','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','Site contact page','','7.50'),('2695','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','When enabled, this overrides the default Drupal behavior for the site contact page at <em>/contact</em>. If no variant is selected, the default Drupal contact form will be used.','','7.50'),('2696','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','Node add/edit form','','7.50'),('2697','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','When enabled, this overrides the default Drupal behavior for adding or edit nodes at <em>node/%node/edit</em> and <em>node/add/%node_type</em>. If you add variants, you may use selection criteria such as node type or language or user access to provide different edit forms for nodes. If no variant is selected, the default Drupal node edit will be used.','','7.50'),('2698','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','All blogs','','7.50'),('2699','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','When enabled, this overrides the default Drupal behavior for the all blogs at <em>/blog</em>. If no variant is selected, the default Drupal most recent blog posts will be shown.','','7.50'),('2700','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','Node template','','7.50');
INSERT INTO `locales_source` VALUES ('2701','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','When enabled, this overrides the default Drupal behavior for displaying nodes at <em>node/%node</em>. If you add variants, you may use selection criteria such as node type or language or user access to provide different views of nodes. If no variant is selected, the default Drupal node view will be used. This page only affects nodes viewed as pages, it will not affect nodes viewed in lists or at other locations. Also please note that if you are using pathauto, aliases may make a node to be somewhere else, but as far as Drupal is concerned, they are still at node/%node.','','7.50'),('2702','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','User profile template','','7.50'),('2703','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','When enabled, this overrides the default Drupal behavior for displaying user profiles at <em>user/%user</em>. If you add variants, you may use selection criteria such as roles or user access to provide different views of user profiles. If no variant is selected, the default Drupal user view will be used. Please note that if you are using pathauto, aliases may make a node to be somewhere else, but as far as Drupal is concerned, they are still at user/%user.','','7.50'),('2704','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','Custom pages','','7.50'),('2705','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','Administrator created pages that have a URL path, access control and entries in the Drupal menu system.','','7.50'),('2706','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','Create a new page','','7.50'),('2707','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','Storage','','7.50');
INSERT INTO `locales_source` VALUES ('2708','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','Comment Reply page','','7.50'),('2709','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','Taxonomy term template','','7.50'),('2710','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','When enabled, this overrides the default Drupal behavior for displaying taxonomy terms at <em>taxonomy/term/%term</em>. If you add variants, you may use selection criteria such as vocabulary or user access to provide different displays of the taxonomy term and associated nodes. If no variant is selected, the default Drupal taxonomy term display will be used. This page only affects items actually displayed ad taxonomy/term/%term. Some taxonomy terms, such as forums, have their displays moved elsewhere. Also please note that if you are using pathauto, aliases may make a taxonomy terms appear somewhere else, but as far as Drupal is concerned, they are still at taxonomy/term/%term.','','7.50'),('2711','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','Edit name, path and other basic settings for the page.','','7.50'),('2712','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','User blog','','7.50'),('2713','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','When enabled, this overrides the default Drupal behavior for displaying user blogs at <em>blog/%user</em>. If no variant is selected, the default Drupal user blog will be used.','','7.50'),('2714','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','User contact','','7.50'),('2715','/drupal/eight/fr/admin/structure/block/manage/lang_dropdown/language/configure?destination=node','default','When enabled, this overrides the default Drupal behavior for displaying the user contact form at <em>user/%user/contact</em>. If no variant is selected, the default Drupal user contact form will be used.','','7.50');
