INSERT INTO `locales_source` VALUES ('3733','/eight/ko/products','default','Ignore case','','7.50'),('3734','/eight/ko/products','default','This processor will make searches case-insensitive for fulltext or string fields.','','7.50'),('3735','/eight/ko/products','default','HTML filter','','7.50'),('3736','/eight/ko/products','default','Strips HTML tags from fulltext fields and decodes HTML entities. Use this processor when indexing HTML data, e.g., node bodies for certain text formats.<br />The processor also allows to boost (or ignore) the contents of specific elements.','','7.50'),('3737','/eight/ko/products','default','Tokenizer','','7.50'),('3738','/eight/ko/products','default','Tokenizes fulltext data by stripping whitespace. This processor allows you to specify which characters make up words and which characters should be ignored, using regular expression syntax. Otherwise it is up to the search server implementation to decide how to split indexed fulltext data.','','7.50'),('3739','/eight/ko/products','default','Stopwords','','7.50'),('3740','/eight/ko/products','default','This processor prevents certain words from being indexed and removes them from search terms. For best results, it should only be executed after tokenizing.','','7.50'),('3741','/eight/ko/products','default','Highlighting','','7.50'),('3742','/eight/ko/products','default','Adds highlighting for search results.','','7.50'),('3743','/eight/ko/products','default','Bundles','','7.50'),('3744','/eight/ko/products','default','Local','','7.50'),('3745','/eight/ko/products','default','1 comment','','7.50'),('3746','/eight/ko/products','default','Showing !count of !total results','','7.50'),('3747','/eight/ko/products','default','Enter the terms you wish to search for.','','7.50'),('3748','/eight/ko/products','default','Search . . .','','7.50'),('3749','/eight/ko/products','default','Sunday','','7.50'),('3750','/eight/ko/products','default','December','Long month name','7.50'),('3751','/eight/ko/products','default','restore feature','','7.50'),('3752','/eight/ko/products','default','Backup and Migrate makes the task of backing up your Drupal database and migrating data from one Drupal install to another easier. It provides a function to backup the entire database to file or download, and to restore from a previous backup. You can also schedule the backup operation. Compression of backup files is also supported.  The database backup files created with this module can be imported into this or any other Drupal installation with the !restorelink, or you can use a database tool such as <a href="!phpmyadminurl">phpMyAdmin</a> or the mysql command line command.','','7.50');
INSERT INTO `locales_source` VALUES ('3753','/eight/ko/products','default','Quick Backup Tab','','7.50'),('3754','/eight/ko/products','default','Use this form to run simple manual backups of your database and files.','','7.50'),('3755','/eight/ko/products','default','Advanced Backup Tab','','7.50'),('3756','/eight/ko/products','default','settings profiles','','7.50'),('3757','/eight/ko/products','default','Use this form to run manual backups of your database and files with more advanced options. If you have any !profilelink saved you can load those settings. You can save any of the changes you make to these settings as a new settings profile.','','7.50'),('3758','/eight/ko/products','default','Restore Tab','','7.50'),('3759','/eight/ko/products','default','Upload a backup and migrate backup file. The restore function will not work with database dumps from other sources such as phpMyAdmin.','','7.50'),('3760','/eight/ko/products','default','Destinations','','7.50'),('3761','/eight/ko/products','default','Destinations are the places you can save your backup files to or them load from.','','7.50'),('3762','/eight/ko/products','default','Files can be saved to a directory on your web server, downloaded to your desktop or emailed to a specified email account. From the Destinations tab you can create, delete and edit destinations or list the files which have already been backed up to the available destinations.','','7.50'),('3763','/eight/ko/products','default','Sources','','7.50'),('3764','/eight/ko/products','default','Sources are the things that can be backed up such as database or file directories.','','7.50'),('3765','/eight/ko/products','default','Profiles','','7.50'),('3766','/eight/ko/products','default','schedules','','7.50'),('3767','/eight/ko/products','default','manual backups','','7.50'),('3768','/eight/ko/products','default','Profiles are saved backup settings. Profiles store your table exclusion settings as well as your backup file name, compression and timestamp settings. You can use profiles in !schedulelink and for !manuallink.','','7.50');
INSERT INTO `locales_source` VALUES ('3769','/eight/ko/products','default','You can create new profiles using the add profiles tab or by checking the "Save these settings" button on the advanced backup page.','','7.50'),('3770','/eight/ko/products','default','Scheduling','','7.50'),('3771','/eight/ko/products','default','Automatically backup up your database and files on a regular schedule using <a href="!cronurl">cron</a>.','','7.50'),('3772','/eight/ko/products','default','Each schedule will run a maximum of once per cron run, so they will not run more frequently than your cron is configured to run. If you specify a number of backups to keep for a schedule, old backups will be deleted as new ones created. <strong>If specifiy a number of files to keep other backup files in that schedule''s destination will get deleted</strong>.','','7.50'),('3773','/eight/ko/products','default','Importing Settings','','7.50'),('3774','/eight/ko/products','default','Import a settings profile, backup schedule, source or destination by pasting the export code into the textarea.','','7.50'),('3775','/eight/ko/products','default','help page','','7.50'),('3776','/eight/ko/products','default','Visit the !helppage for more help using this module.','','7.50'),('3777','/eight/ko/products','default','Facet active','','7.50'),('3778','/eight/ko/products','default','Sort by whether the facet is active or not.','','7.50'),('3779','/eight/ko/products','default','Sort by the facet count.','','7.50'),('3780','/eight/ko/products','default','Display value','','7.50'),('3781','/eight/ko/products','default','Sort by the value displayed to the user.','','7.50'),('3782','/eight/ko/products','default','Indexed value','','7.50'),('3783','/eight/ko/products','default','Sort by the raw value stored in the index.','','7.50'),('3784','/eight/ko/products','default','Apply @text filter','','7.50'),('3785','/eight/ko/products','default','!field_name ranges from !prefix_field_products%3Acommerce_price%3Aamount_dec